import React from 'react';

export default function FullList(){
  const songlist = Object.keys({'a':1,'b':2,'c':3})//really (Object.keys(getListofObjectsFromDb()))
  const nl = songlist.map((n,i)=><li>{`${n}`}<button>Delete</button></li>)

  return(
    <div id = 'listDiv'>
      <h2>List of Songs</h2>
      <ul>{nl}</ul>
    </div>
  )
}
